	public void testString() throws SerializationException, ValidityException, IOException, ParsingException, org.xmldap.exceptions.ParsingException {
		String roamingStoreString = null;
		roamingStoreString = roamingStore.toXML();
		RoamingStore store = new RoamingStore(roamingStoreString);
		String storeString = store.toXML();
		assertEquals(roamingStoreString, storeString);
	}
	
	public void testUnknownElementRoamingStore() throws ValidityException, IOException, ParsingException, org.xmldap.exceptions.ParsingException, SerializationException {
		RoamingStore unknownElementRoaminstore = new RoamingStore(unknownElementRoaminstoreString);
		SortedSet<RoamingInformationCard> rics = unknownElementRoaminstore.getRoamingInformationCards();
		Iterator<RoamingInformationCard> iter = rics.iterator();
		int numRics = 0;
		for (; iter.hasNext(); numRics++) iter.next();
		assertEquals(1, numRics);
		
		iter = rics.iterator();
		RoamingInformationCard ric = iter.next();
		InformationCardMetaData meta = ric.informationCardMetaData;
		
		Map<String, String>issuerInformation = meta.getIssuerInformation();
		assertNotNull(issuerInformation);
		assertEquals(1, issuerInformation.size());
		
		List<Element> bastards = meta.getBastards();
		assertEquals(1, bastards.size());
		
		String expected = "<unknownElement xmlns=\"http://unknown\"><donNotknowThisOneEither /><norThis /></unknownElement>";
		assertEquals(expected, bastards.get(0).toXML());
		
		// assert that the unknown elements are back in the serialized store
		String serializedStore = unknownElementRoaminstore.toXML();
		assertTrue(serializedStore.indexOf(expected) >= 0);
	}
